import React from 'react';
import { FileText } from 'lucide-react';

const SortingInterface: React.FC = () => {
  return (
    <div className="text-center py-12">
      <FileText className="h-12 w-12 text-gray-400 mx-auto mb-4" />
      <h3 className="text-lg font-medium text-gray-900 mb-2">Alphabetical Sorting</h3>
      <p className="text-gray-600">
        This component will provide tools for sorting statutes alphabetically.
        <br />
        <span className="text-sm text-gray-500">Coming soon in the next iteration.</span>
      </p>
    </div>
  );
};

export default SortingInterface;
